import React from "react";
import BackgroundCss from "./mainbackground.module.css";

function MainBackground() {
  return (
    <>
      <div>
        <h1>Unlimited movies, TV shows, and more</h1>
        <p>Watch anywhere. Cancel anytime.</p>
        <p className={BackgroundCss.text}>
          Ready to watch? Enter your email to create or restart your membership.
        </p>

        <div className={BackgroundCss.container}>
          <input
            type="text"
            className={BackgroundCss.mail}
            placeholder="Email address"
          ></input>
          <button className={BackgroundCss.btn}>Get Started &gt;</button>
        </div>
      </div>
    </>
  );
}

export default MainBackground;
